import './App.css';

function App() {
  return (
    <div className="App">
      <h1>Manifest Gudang Senjata</h1>
      <div className="form">
        <h2>Masukkan Item Baru pada tabel senjata.</h2>
        <label>Nama: </label>
        <input type="text"></input>
        <label>Varian: </label>
        <input type="text"></input>
        <label>Amunisi: </label>
        <input type="text"></input>
        <label>Jumlah: </label>
        <input type="number"></input>
      </div>
    </div>
  );
}

export default App;
